import React from "react";
import { useSelector } from "react-redux";
import ItemPhim from "../ItemPhim/ItemPhim";

export default function ListPhim() {
  const { arrFilm } = useSelector((state) => state.layDanhSachPhimReducer);

  const renderDSPhim = () => {
    return arrFilm.map((phim, index) => {
      return <ItemPhim key={index} phim={phim} />;
    });
  };
  return (
    <div className="container mx-auto">
      <div className=" flex flex-wrap">{renderDSPhim()}</div>
    </div>
  );
}
